    true,nt"url": null,nt"notes": "The Emissions & Generation Resource Integrated
    Database (eGRID) is a comprehensive source of data on the environmental characteristics
    of almost all electric power generated in the United States. These environmental
    characteristics include air emissions for nitrogen oxides, sulfur dioxide, carbon
    dioxide, methane, and nitrous oxide; emissions rates; net generation; resource mix;
    and many other attributes.nneGRID2010 contains the complete release of year 2007
    data, as well as years 2005 and 2004 data.  Excel spreadsheets, full documentation,
    summary data, eGRID subregion and NERC region representational maps, and GHG emission
    factors are included in this data set.  The Archived data in eGRID2002 contain years
    1996 through 2000 data.nnFor year 2007 data, the first Microsoft Excel workbook,
    Plant, contains boiler, generator, and plant spreadsheets. The second Microsoft
    Excel workbook, Aggregation, contains aggregated data by state, electric generating
    company, parent company, power control area, eGRID subregion, NERC region, and U.S.
    total levels. The third Microsoft Excel workbook, ImportExport, contains state import-export
    data, as well as U.S. generation and consumption data for years 2007, 2005, and
    2004.  For eGRID data for years 2005 and 2004, a user friendly web application,
    eGRIDweb, is available to select, view, print, and export specified data.",nt"license_title":
